DECLARE @RC AS INT, @pLoadId AS INT, @pInsertedRowCount AS BIGINT;

SELECT @RC = 0,
       @pLoadId = 0;

EXECUTE @RC = [FPV].[uspDistribution] @pLoadId, @pInsertedRowCount OUTPUT;

SELECT @RC AS RC,
       @pInsertedRowCount AS pInsertedRowCount;

